  false,\n\t\"url\": null,\n\t\"notes\": \"In March 1992, a planning team met to identify
  issues, set objectives and develop strategies for management of the three refuges.
  The information from the planning workshop was synthesized into this document, the
  Station Management Plan, to provide the Refuge Manager with overall management direction
  for the next 3-5 years. The strategies developed provide the starting point to work
  toward the long term goals of 1) a wildlife and habitat data base, 2) management
  of eagle and other wildlife habitat, 3) a public that supports refuge programs,
  4) minimal losses caused by wildfire and 5) protection of historic and archaeological
  resources.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
